def response_function(df):
    import pandas as pd
    import numpy as np

    # Create a dictionary to store the results
    result = {}

    # Iterate over the unique prefixes in the column names
    for prefix in set(col.split('_')[0] for col in df.columns):
        # Select the columns with the current prefix
        sub_df = df[[col for col in df.columns if col.startswith(prefix)]]

        # Identify the column with the value 1 for each row
        result[prefix] = sub_df.dot(sub_df.columns).replace('', np.nan)

    # Convert the result dictionary into a dataframe
    return pd.DataFrame(result)

